import { useEffect, useState } from "react";
import Login from "../Auth/login/login";
import Books from "./book";
import { Link, useNavigate, useSearchParams } from "react-router-dom";
import NavbarComponent from "../navbar";
import axios from "axios";
import { Button, Card, ListGroup, Nav, Row } from "react-bootstrap";

function CustomerDashboard() {
  const navigate = useNavigate();
  const [param] = useSearchParams();
  const [qStr, setQstr] = useState('');
  const [book, setBooks] = useState([]);
  const [categories, setCategories] = useState([]);
  const [msg, setMsg] = useState('');
  const [loading, setLoading] = useState(false);
  const [category, setCategory] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8182/Book/all')
      .then(response => setBooks(response.data))

    axios.get('http://localhost:8182/category/getall')
      .then(response => setCategories(response.data))
      .catch(error => setMsg('Error in Fetching categories'));
  }, [])

  const redirectToBookDetails = (bookId) => {
    navigate(`/Book/getwithauthdesc?id=${bookId}`);
  };

  const searchBooks = (str) => {
    console.log('search func in parent comp called.....' + str)
    setQstr(str);
  };

  const getbookcategory = async (id) => {
    setLoading(true);
    const response = await axios.get(`http://localhost:8182/customer/getbycategoryid?id=${id}`);
    console.log('API response:', response);
    setBooks(response.data || []);
  };

  return (
    <div style={{ backgroundColor: "#ecf0f1", padding: 20 }}>
      <NavbarComponent func={searchBooks} />
      <Row>
        <div className="col-md-4">
          <Card style={{ width: "27rem", margin: 20 }}>
            <Card.Header style={{ backgroundColor: "#3498db", color: "#fff" }}>
              <h3 style={{ fontFamily: "Arial, sans-serif" }}>Categories</h3>
            </Card.Header>
            <ListGroup>
              {categories.map((c, index) => (
                <div key={index}>
                  <ListGroup.Item>
                    <Nav.Link onClick={() => { getbookcategory(c.id); }}>
                      <h4 style={{ color: "#2c3e50", fontWeight: "bold", fontFamily: "Verdana, sans-serif" }}>
                        {c.name}
                      </h4>
                    </Nav.Link>
                  </ListGroup.Item>
                </div>
              ))}
            </ListGroup>
          </Card>
        </div>
        <div className="col-md-8">
          <Row>
            {book.map((b, index) => (
              <div key={index} className="col-md-4 mb-4">
                <Card style={{ width: '400px', backgroundColor: '#your_color_here' }}>
                  <Card.Body>
                    <Link to={`/books/${b.id}`}>
                      <Card.Title>{b.bookTitle}</Card.Title>
                    </Link>
                    <hr />
                  </Card.Body>
                  <div>
                    <div style={{ display: 'flex', flexDirection: 'column', marginBottom: '10px' }}>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Rating:</span> {b.rating}
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Author:</span>
                        <a href={`link/to/author/${b.author}`} target="_blank" rel="noopener noreferrer">
                          {b.author}
                        </a>
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Category:</span> {b.category.name}
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Price:</span> {b.bookPrice}
                      </div>
                    </div>
                    <Button style={{ width: 200, alignSelf: "center", margin: 15 }} variant="outline-primary" href='/auth/login'>Add to cart</Button>
                  </div>
                </Card>
              </div>
            ))}
          </Row>
        </div>
      </Row>
    </div>
  );
}
export default CustomerDashboard;
